import React from "react";
import "./style.css";

function Jumbotron({ children }) {
  return (
    <div
      style={{ height: 300, clear: "both", paddingTop: 60, margin: 20, textAlign: "center", color: "blue", border: 2, "solid": "black" }}
      className="jumbotron"
    >
      {children}
    </div>
  );
}

export default Jumbotron;
